from sympy import isprime
def emirp(n):
    revn = int(str(n)[::-1])
    return n != revn and isprime(n) and isprime(revn)
def ok(n):
    if not emirp(n): return False
    q = int(str(n)[::-1])
    return emirp((n*q)%(n+q))
print([k for k in range(10**5) if ok(k)]) # _Michael S. Branicky_, Sep 04 2022

